Example 1: Demonstrating the GIL's Impact on CPU-bound Operations This example demonstrates how the GIL can limit the performance of CPU-bound multi-threaded programs. import threading
import time # A simple CPU-bound function
def cpu_bound_task(): count = 0 while count < 10000000: count += 1 start_time = time.time()
threads = []
for _ in range(2): # Create 2 threads thread = threading.Thread(target=cpu_bound_task) thread.start() threads.append(thread) for thread in threads: thread.join() end_time = time.time()
print(f"Duration with threads: {end_time - start_time} seconds") Example 2: I/O-bound Multi-threading The next example demonstrates how multi-threading can be beneficial for I/O-bound tasks, as the GIL is released during I/O operations, allowing other threads to run. import threading
import time # A simple I/O-bound function that waits for some time, simulating an I/O operation
def io_bound_task(): print("Task start") time.sleep(2) # Simulate an I/O operation print("Task complete") start_time = time.time()
threads = []
for _ in range(2): # Create 2 threads thread = threading.Thread(target=io_bound_task) thread.start() threads.append(thread) for thread in threads: thread.join() end_time = time.time()
print(f"Duration with threads: {end_time - start_time} seconds") In the CPU-bound example, you might not notice a significant performance improvement from using threads due to the GIL. In contrast, the I/O-bound example can benefit from multi-threading, as threads waiting for I/O allow others to run, potentially improving overall efficiency.

