def sum_of_squares(int n): # Declaring a C int type for the loop variable. cdef int i cdef int sum = 0 for i in range(n): sum += i * i return sum Next, you need to create a setup.py file to compile the Cython module: from setuptools import setup
from Cython.Build import cythonize setup( ext_modules=cythonize("sum_squares.pyx", annotate=True)
) Compile the Cython module by running: python setup.py build_ext --in-place Finally, you can use the compiled module in Python: # Import the compiled Cython module
import sum_squares # Call the Cython function
print(sum_squares.sum_of_squares(10)) # Output: 285 The key takeaway is that you need to add type annotations!
